// Helper functions

func getStackDisplayName(stack string) string {
	switch stack {
	case "opstack":
		return "OP STACK"
	case "nitro":
		return "ARBITRUM NITRO"
	default:
		return strings.ToUpper(stack)
	}
}

func getNetworkName(chainID string) string {
	switch chainID {
	case "1":
		return "Ethereum Mainnet"
	case "11155111":
		return "Sepolia (Testnet)"
	case "17000":
		return "Holesky (Testnet)"
	default:
		return "Chain " + chainID
	}
}

func getDADisplayName(da string) string {
	switch da {
	case "celestia":
		return "Celestia"
	case "anytrust":
		return "AnyTrust DAC"
	case "calldata":
		return "L1 Calldata"
	default:
		if da == "" {
			return "Default"
		}
		return strings.ToUpper(da)
	}
}

func getKeyName(keys []components.KeyOption, keyID string) string {
	for _, k := range keys {
		if k.ID == keyID {
			return k.Name
		}
	}
	if keyID == "" {
		return "(not selected)"
	}
	return keyID[:8] + "..."
}

